import React from "react";
import "./NavBar.module.css";
import { Link } from "react-router-dom";
import { data } from "./data";
const NavBar = () => {
  return (
    <div id="main-menu">
      {" "}
      <menu className={NavBar.main}>
        <label id="hamburger-menu">
          <input type="checkbox" />
          <span className={NavBar.menu}>
            {" "}
            <span className={NavBar.hamburger}></span>{" "}
          </span>
          <ul className="ul">
            {data.map((ele, i) => {
              return (
                <div key={i}>
                  {" "}
                  <br />
                  <li>
                    {" "}
                    <Link id="li" to={ele.path}>
                      {ele.name}
                    </Link>
                  </li>{" "}
                  <br />
                </div>
              );
            })}{" "}
            <br />
          </ul>{" "}
          {/* </div> */}
          {/* <li>
              {" "}
              <Link className="li" to="/">
                Order
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Leaderboards
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/">
                Marketplace
              </Link>{" "}
            </li>{" "}
            <br />
            <br />
            <li>
              {" "}
              <Link className="li" to="/faqs">
                FAQs
              </Link>{" "}
            </li>{" "} */}
          {/* <br /> <br /> */}
        </label>
      </menu>
      <div className="div">
        <Link to="/home">
          <img
            className="logo"
            src="./images/Twenteefore - Logo 2.png"
            alt="logo"
          />
        </Link>
        <nav className="navbar">
          {data.map((element, index) => {
            return (
              <div key={index}>
                <Link className={element.className} to={element.path}>
                  {element.name}
                </Link>
              </div>
            );
          })}{" "}
        </nav>

        {/* <Link className="homeLink" to="/">
          Home
        </Link>
        <Link className="orderLink" to="/">
          Order
        </Link>
        <Link className="leaderboardsLink" to="/">
          Leaderboards
        </Link>{" "}
        <Link className="marketplaceLink" to="/">
          Marketplace
        </Link>{" "}
        <Link className="faqsLink" to="/faqs">
          FAQs
        </Link> */}
      </div>
      <Link className="loginLink" to="/login">
        <button id="loginLink">Log In</button>
      </Link>
    </div>
  );
};
export default NavBar;
